import React from 'react';
import './CompanyProfile.css';

function CompanyProfile() {
  return (
    <section className="company-profile">
      <div className="profile-container">
        <h1 className="profile-title">Our Company Profile</h1>
        <p className="profile-text">
          Arbab Pack Ltd through the last stage of the production, occupies a paramount importance in framing the business strategy. 
          Since attractive and durable packaging is the main marketing tool to increase the market share of the company, every business entry 
          looks for distinctive packaging solutions for its products. ARBAB PACK LTD is a certified manufacturer of forward-thinking Paper Converter 
          & Flexible Packaging for materials. The Company Offers a comprehensive range of products such as Paper & Paper Board Products Laminates, 
          Rolls & Pouches, Paper packaging materials, dairy products pouches, snack packs, etc.
        </p>
        <p className="profile-text">
          The company is committed to providing world-class packaging products at highly economical prices. With our in-depth expertise in the discipline, 
          the company is capable of providing Paper/Paper Board based packing material, flexible packaging for specific products with tailor-made specifications 
          and finest printing & finishing. The company is managed and promoted by a group of experienced professionals having versatile knowledge of the concerned discipline.
        </p>
      </div>
    </section>
  );
}

export default CompanyProfile;
